import React from "react";
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';

const Menu = () => {
    
    return (
        <div>
            <h1> Tennis Quiz </h1>
            <ul>
                <li>
                    <Button as="a" variant="primary">
                        <Link to="/quiz"> Start </Link>
                    </Button>
                </li>
            </ul>
        </div>
    );
}

export default Menu;
